  display: flex;
  height: 70px;
}
.nav {
  display: flex;
  width: 100%;
  &--font {
    font-family: $font-Basis;
  }
  & .font-color {
    color: rgba(5, 54, 252, 1);
  }
  &__logo {
    display: flex;
    align-items: flex-start;
    &-img {
      width: 39px;
      height: 57px;
      margin-right: 10px;
      margin-top: 6px;
    }
    &-text {
      font-size: 16px;
      font-weight: 300;
      line-height: 24px;
      letter-spacing: -0.03em;
      text-align: left;
      opacity: 0.3;
    }
  }
  &__list {
    display: flex;
    margin-left: auto;
    align-items: center;
    &-item--text-style {
      text-decoration: none;
      color: black;
      opacity: 0.85;
      text-transform: uppercase;
      font-size: 16px;
      font-weight: 400;
      line-height: 24px;
      letter-spacing: -0.03em;
      text-align: left;
    }
  }
  &__support-link {
    margin-left: 50px;
  }
  &__stories-link {
    margin-left: 50px;
  }
  &__about-us-link {
    margin-left: 101px;
  }
  &__partners-link {
    margin-left: 50px;
  }
}
.lang-picker-holder {
  position: absolute;
  right: 80px;
  background-color: rgba(255, 255, 255, 0.7);
  z-index: 10;
}
.lang-picker-item:hover {
  background-color: rgba(5, 54, 252, 0.3);
}

.lang-picker-holder,
.lang-btn {
  display: none;
}
.lang-btn:checked ~ .lang-picker-holder {
  display: flex;
}
.lang-btn:checked ~ .lang-filters > .down-arrow {
  transform: rotate(225deg) translate(0px, -5px);
}
.lang-filters {
  cursor: pointer;
}
.dropdown {
  cursor: pointer;
  margin-left: 14.8vw;
}
.down-arrow {
  border: solid black;
  border-width: 0 1px 1px 0;
  display: inline-block;
  padding: 3px;
  width: 10px;
  height: 10px;
  transform: rotate(45deg) translate(-5px);
  margin-left: 15px;
  cursor: pointer;
  margin-right: 10px;
  &--color {
    border-color: rgb(5, 54, 252);
  }
}

